import Sidebar from '../Components/Sidebar';

function Bdd() {
  return (
    <div className='App'>
      <table className='table'>
        <tr>
          <td>
            <Sidebar />
          </td>
          <td>
            <h1>BDD TITEL</h1>
          </td>
        </tr>
      </table>
    </div>
  );
}

export default Bdd;
